   "source": [
    "result <- df %>%\n",
    "  dplyr::select(koi_period, koi_fpflag_ss, koi_depth) %>% # \n",
    "  \n",
    "  filter(koi_period <= quantile(koi_period, 0.20, na.rm = TRUE)) %>%\n",
    "  \n",
    "  group_by(koi_fpflag_ss) %>% \n",
    "  \n",
    "  summarise(\n",
    "    Variance_Depth = var(koi_depth, na.rm = TRUE), \n",
    "    Count = n(),                                   \n",
    "    Mean_Depth = mean(koi_depth, na.rm = TRUE)    \n",
    "  )\n",
    "\n",
    "print(result)\n",
    "\n",
    "df_filtered <- df %>% \n",
    "  filter(koi_period <= quantile(koi_period, 0.20, na.rm = TRUE))\n",
    "\n",
    "ggplot(df_filtered, aes(x = as.factor(koi_fpflag_ss), y = log10(koi_depth))) +\n",
    "  geom_boxplot() +\n",
    "  labs(title = \"Распределение глубины транзита (Log10)\",\n",
    "       subtitle = \"Для объектов с коротким периодом (топ 20%)\",\n",
    "       x = \"Флаг: Спутник (Stellar Eclipse)\",\n",
    "       y = \"Log10(Глубина транзита)\")"
   ]
  },
