   "source": [
    "Анализ 20% объектов с наименьшим орбитальным периодом показал, что наличие звездного затмения является фактором, который сильно влияет на характеристики транзита.\n",
    "1. Объекты отмеченные, как ложноположительные из-за звездных затмений, показывают значительно более высокую дисперсию глубины транзита (примерно в 6 раз больше), чем объекты без отметки.\n",
    "Что можно здесь написать по содержанию знает только сам Галлилей..."
   ]
