   "source": [
    "plot_data <- df %>%\n",
    "  dplyr::select(koi_period, koi_prad, koi_fpflag_ss) %>% \n",
    "  drop_na() %>%\n",
    "  mutate(Тип = ifelse(koi_fpflag_ss == 1, \n",
    "                       \"Двойная звезда (Stellar Eclipse)\", \n",
    "                       \"Кандидат в планеты\"))\n",
    "\n",
    "ggplot(plot_data, aes(x = koi_period, y = koi_prad)) +\n",
    "  geom_point(aes(color = Тип, alpha = Тип), size = 2) + \n",
    "  \n",
    "  scale_x_log10(breaks = c(1, 10, 100, 365, 1000), \n",
    "                labels = c(\"1 д\", \"10 д\", \"100 д\", \"1 г\", \"3 г\")) +\n",
    "  scale_y_log10(breaks = c(1, 11.2, 100, 1000),\n",
    "                labels = c(\"Земля (1)\", \"Юпитер (11)\", \"100\", \"1000\")) +\n",
    "  \n",
    "  scale_color_manual(values = c(\"Двойная звезда (Stellar Eclipse)\" = \"#E41A1C\", \n",
    "                                \"Кандидат в планеты\" = \"#377EB8\")) +\n",
    "  \n",
    "  scale_alpha_manual(values = c(\"Двойная звезда (Stellar Eclipse)\" = 0.7, \n",
    "                                \"Кандидат в планеты\" = 0.5)) +\n",
    "  \n",
    "  labs(title = \"Орбитальный период vs Радиус объекта\",\n",
    "       subtitle = \"Классификация объектов миссии Kepler\",\n",
    "       x = \"Орбитальный период\",\n",
    "       y = \"Радиус (в радиусах Земли)\",\n",
    "       color = NULL,  \n",
    "       alpha = NULL) + \n",
    "  \n",
    "  theme_minimal(base_size = 14) +\n",
    "  theme(\n",
    "    legend.position = c(0.02, 0.98),\n",
    "    legend.justification = c(\"left\", \"top\"),\n",
    "    legend.background = element_rect(fill = \"white\", color = \"gray\", size = 0.5),\n",
    "    legend.margin = margin(6, 6, 6, 6),\n",
    "    panel.grid.minor = element_blank(),\n",
    "    plot.title = element_text(face = \"bold\", size = 16),\n",
    "    axis.text = element_text(color = \"black\")\n",
    "  ) +\n",
    "  \n",
    "  geom_hline(yintercept = 11.2, linetype = \"dashed\", color = \"black\", alpha = 0.5) +\n",
    "  annotate(\"text\", x = 1000, y = 13, label = \"R = Юпитер\", \n",
    "           color = \"black\", size = 4, hjust = 1, vjust = 0)"
   ]
  },
