   "source": [
    "В целом, можно достаточно неплохо выделить основную идею, для кластеризации по этому графику, хотя он  и не без проблем. Кандидаты в планеты и двойные звезды встречаются практически на всем диапазоне радиусов. Но нельзя не заметить, что у нас есть два скопления точек, разделенные линией размера юпитера. То есть, если объект меньше юпитера - шанс того, что это кандидат в планеты больше, чем шанс на двойную звезду. И наоборот соответственно. \n",
    "\n",
    "По поводу орбитального периода что-то сказать сложно, потому что здесь все совсем печально. Разве что можно заметить, что после орбитального периода в 100 дней, кандидаты в планеты встречаются намного чаще. На значения периода <100, количество точек примерно сопоставимо."
   ]
  },
