   "source": [
    "plot_data <- df %>%\n",
    "   dplyr::select(koi_pdisposition, koi_fpflag_ss) %>%\n",
    "  drop_na() %>%\n",
    "  mutate(\n",
    "    Status = factor(koi_pdisposition, \n",
    "                    levels = c(\"CANDIDATE\", \"FALSE POSITIVE\"),\n",
    "                    labels = c(\"Кандидат\", \"Ложноположительный\")),\n",
    "    Eclipse_Flag = factor(koi_fpflag_ss, \n",
    "                          levels = c(0, 1),\n",
    "                          labels = c(\"Нет затмения (0)\", \"Есть затмение (1)\"))\n",
    "  )\n",
    "\n",
    "contingency_table <- table(plot_data$Status, plot_data$Eclipse_Flag)\n",
    "\n",
    "chi_test <- chisq.test(contingency_table)\n",
    "\n",
    "print(chi_test)\n",
    "n <- sum(contingency_table)\n",
    "cramers_v <- sqrt(chi_test$statistic / (n * (min(dim(contingency_table)) - 1)))\n",
    "print(paste(\"Cramer's V:\", round(cramers_v, 3)))\n",
    "\n",
    "plot_summary <- plot_data %>%\n",
    "  count(Eclipse_Flag, Status) %>%\n",
    "  group_by(Eclipse_Flag) %>%\n",
    "  mutate(Percent = n / sum(n) * 100)\n",
    "\n",
    "ggplot(plot_summary, aes(x = Eclipse_Flag, y = Percent, fill = Status)) +\n",
    "  geom_bar(stat = \"identity\", position = \"fill\") + \n",
    "  geom_text(aes(label = paste0(round(Percent, 1), \"%\\n(n=\", n, \")\")), \n",
    "            position = position_fill(vjust = 0.5), \n",
    "            color = \"white\", fontface = \"bold\") +\n",
    "  scale_y_continuous(labels = scales::percent) +\n",
    "  scale_fill_manual(values = c(\"Кандидат\" = \"#377EB8\", \"Ложноположительный\" = \"#E41A1C\")) +\n",
    "  labs(\n",
    "    title = \"Влияние звездных затмений на статус экзопланеты\",\n",
    "    subtitle = paste0(\"Результат Chi-squared test: p-value < 2.2e-16, V Крамера = \", round(cramers_v, 2)),\n",
    "    x = \"Флаг звездного затмения\",\n",
    "    y = \"Доля объектов\",\n",
    "    fill = \"Статус\"\n",
    "  ) +\n",
    "  theme_minimal(base_size = 14)"
   ]
  },
