    "data_clean <- df %>%\n",
    "  dplyr::select(koi_prad, koi_depth) %>%\n",
    "  drop_na() %>%\n",
    "  filter(koi_depth > 0, koi_prad > 0) \n",
    "\n",
    "data_clean$New_Var <- data_clean$koi_prad / data_clean$koi_depth\n",
    "\n",
    "descdist(data_clean$New_Var, boot = 100) \n"
   ]
