   "source": [
    "По графику Каллера-Фрея визуально видно, что данные находятся в зоне бета-распределения. Но математически, по методу максимального правдободобия и AIC, логнормальное распределение выигрывает. На q-q плоте видно, что остатки в целом очень хорошо ложатся на прямую для логнормального распределения, разве что хвост улает вверх, но так не так много значений. Скорее всего из-за этого хвоста точка на графике Каллена-Фрея улетела от логнормального распределения, потому что он достаточно чувствителен к таким выбросам, вроде бы, наверное, я так думаю по крайней мере."
   ]
