   "source": [
    "data_anova <- df %>%\n",
    "  dplyr::select(koi_prad, koi_teq, koi_fpflag_ss) %>% \n",
    "  drop_na() %>%\n",
    "  mutate(\n",
    "    Median_Temp = median(koi_teq, na.rm = TRUE),\n",
    "    Temp_Binary = ifelse(koi_teq < Median_Temp, \"Low Temp\", \"High Temp\"),\n",
    "    Temp_Binary = factor(Temp_Binary, levels = c(\"Low Temp\", \"High Temp\")),\n",
    "    \n",
    "    SS_Flag = factor(koi_fpflag_ss, \n",
    "                     levels = c(0, 1),\n",
    "                     labels = c(\"No Eclipse\", \"Eclipse\"))\n",
    "  )\n",
    "\n",
    "ggplot(data_anova, aes(x = Temp_Binary, y = log10(koi_prad), fill = SS_Flag)) +\n",
    "  geom_boxplot() +\n",
    "  labs(title = \"Радиус (log10) vs Температура и Затмение\")\n",
    "\n",
